import "./Skills.scss";

const Skills = () => {
  document.addEventListener("DOMContentLoaded", function() {
    const slideCardContainer = document.getElementById('imageContainer');
    const slideCardHolder = document.getElementById('skills');
  
    console.log(slideCardContainer)
    console.log(slideCardHolder)
  })


  const param:number = slideCardHolder?.offsetHeight!;
  const containerLength:number = slideCardContainer?.offsetTop!;
  console.log(containerLength)
  console.log(param)

  if ( containerLength > (param)/5) {
    console.log('height trigger works');
  }

  return (
    <div className="skills" id="skills">
      <div className="image-container" id="imageContainer">
        <div className="skill-card skill-card-6" id="skill6">
          TypeScript
        </div>
        <div className="skill-card skill-card-5" id="skill5">
          React
        </div>
        <div className="skill-card skill-card-4" id="skill4">
          JS
        </div>
        <div className="skill-card skill-card-3" id="skill3">
          SCSS
        </div>
        <div className="skill-card skill-card-2" id="skill2">
          CSS
        </div>
        <div className="skill-card skill-card-1" id="skill1">
          HTML
        </div>
      </div>
    </div>
  );
};

export default Skills;
